import { useState } from 'react';
// import Button from 'react-bootstrap/Button';
import Offcanvas from 'react-bootstrap/Offcanvas';
import './offcanvas.css';
import { FaBeer, FaLock } from 'react-icons/fa';


export const OffCanva =() => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      {/* <Button onClick={handleShow}>
      <FaBeer onClick={handleShow}/>
      </Button> */}
      <FaBeer onClick={handleShow}/>


      <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton className='d-flex justify-content-center'>
          <Offcanvas.Title>13VENTURES</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body className='heading'>
            <div>Think Beyond</div>
            <div>MicroFrameworks</div>
         <ul>
            <li className='mt-5 ms-2'><FaLock/><span>Business Model Canvas</span></li>
            <li><FaLock/><span className='ms-2 pt-3'>Lean Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Business Envoirment Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Maeket Context Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Value Proposition Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Empathy Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Personal Building Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Value Chain Mapping Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Competitor Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Journey Mapping Canvas</span></li>
            <li><FaLock/><span className='ms-2'>Market Sizzing Canvas</span></li>
         </ul>
        </Offcanvas.Body>
      </Offcanvas>
    </>
  );
}
